import Home from '@/views/Home.vue';
import History from '@/views/History.vue';
import Request from '@/views/Request.vue';
import Portfolio from '@/views/Portfolio.vue';

// 詳細ページのルート設定

// メインルート
const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home,
    meta: {
      title: 'Home'
    }
  },
  {
    path: '/history',
    name: 'History',
    component: History,
    meta: {
      title: 'History'
    }
  },
  {
    path: '/request',
    name: 'Request',
    component: Request,
    meta: {
      title: 'Request'
    }
  },
  {
    path: '/portfolio',
    name: 'Portfolio',
    component: Portfolio,
    meta: {
      title: 'Portfolio'
    }
  },
  // 各カテゴリの詳細ページルートを追加
];
